import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click search input to focus
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.click('#searchInput');

    // Type search query
    await page.fill('#searchInput', 'electronics');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_entered.png'));

    // Click search button
    await page.click('.search-btn');
    await page.waitForTimeout(1000); // Brief pause for results

    // Extract product data
    const productData = await page.evaluate(() => {
      const products = [];
      const productCards = document.querySelectorAll('.product-card');

      productCards.forEach(card => {
        const title = card.querySelector('.product-title')?.textContent || '';
        const price = card.querySelector('.product-price')?.textContent || '';
        const rating = card.querySelector('.stars')?.textContent || '';
        products.push({ title, price, rating });
      });

      return products;
    });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Navigate to profile section
    await page.click('a[href="#"]:has-text("Your Profile")');
    await page.waitForTimeout(1000);

    // Extract profile data
    const profileData = await page.evaluate(() => {
      return {
        username: document.querySelector('.username')?.textContent || '',
        fullName: document.querySelector('h2')?.textContent || '',
        bio: document.querySelector('.bio')?.textContent || ''
      };
    });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_profile_data.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_profile_data.png'));

    return {
      success: true,
      action: "Extracted product listings and user profile data in bulk",
      extractedData: {
        products: productData,
        profile: profileData
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data extraction",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
